explanationOfDynamicParameters=\u062A\u062D\u062F\u062F \u062E\u0627\u0646\u0629 \u0627\u062E\u062A\u064A\u0627\u0631 \u2019\u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u062F\u064A\u0646\u0627\u0645\u064A\u0643\u064A\u0629\u2018 \u0643\u064A\u0641\u064A\u0629 \u062A\u0633\u0644\u064A\u0645 \u0639\u0648\u0627\u0645\u0644 \u062A\u0635\u0641\u064A\u0629 \u0627\u0644\u0642\u064A\u0645 \u0627\u0644\u0641\u0631\u062F\u064A\u0629 \u0648\u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A\u0647\u0627 \u0644\u0633\u064A\u0627\u0642 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0625\u0644\u0649 \u0647\u062F\u0641 \u0627\u0644\u062A\u0646\u0642\u0644. \u064A\u062A\u0636\u0645\u0646 \u0633\u064A\u0627\u0642 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0643\u0644 \u0642\u064A\u0645 \u0639\u0648\u0627\u0645\u0644 \u0627\u0644\u062A\u0635\u0641\u064A\u0629 \u0648\u0627\u0644\u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u0645\u0646 \u0639\u0648\u0627\u0645\u0644 \u062A\u0635\u0641\u064A\u0629 \u0639\u0627\u0645\u0629 \u0645\u0639\u064A\u0646\u0629 \u0641\u064A \u0634\u0631\u064A\u0637 \u0627\u0644\u062A\u0635\u0641\u064A\u0629 \u0648\u0627\u0644\u062A\u062D\u062F\u064A\u062F\u0627\u062A \u0641\u064A \u062E\u0637\u0648\u0627\u062A \u0627\u0644\u062A\u062D\u0644\u064A\u0644 \u0648\u0633\u064A\u0627\u0642 \u062A\u0637\u0628\u064A\u0642 \u0622\u062E\u0631 \u062A\u0645 \u0645\u0646\u0647 \u0628\u062F\u0621 \u062A\u0634\u063A\u064A\u0644 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0627\u0644\u0645\u0639\u062A\u0645\u062F \u0639\u0644\u0649 APF.\n\n\u0641\u064A \u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0627\u0641\u062A\u0631\u0627\u0636\u064A\u060C \u0644\u0627 \u064A\u062A\u0645 \u062A\u062D\u062F\u064A\u062F \u062E\u0627\u0646\u0629 \u0627\u0644\u0627\u062E\u062A\u064A\u0627\u0631. \u0641\u064A \u0647\u0630\u0647 \u0627\u0644\u062D\u0627\u0644\u0629\u060C \u064A\u062A\u0645 \u062A\u0633\u0644\u064A\u0645 \u0633\u064A\u0627\u0642 \u0627\u0644\u062A\u0637\u0628\u064A\u0642 \u0625\u0644\u0649 \u0647\u062F\u0641 \u0627\u0644\u062A\u0646\u0642\u0644 \u0639\u0646 \u0637\u0631\u064A\u0642 \u062D\u0627\u0648\u064A\u0629 xApp state.\n\n\u062D\u062F\u062F \u062E\u0627\u0646\u0629 \u0627\u062E\u062A\u064A\u0627\u0631 \u2019\u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u062F\u064A\u0646\u0627\u0645\u064A\u0643\u064A\u0629\u2018 \u0644\u0639\u0631\u0636 \u0643\u0644 \u0639\u0648\u0627\u0645\u0644 \u062A\u0635\u0641\u064A\u0629 \u0627\u0644\u0642\u064A\u0645 \u0627\u0644\u0641\u0631\u062F\u064A\u0629 \u0648\u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A\u0647\u0627 \u0645\u0646 \u0627\u0644\u0633\u064A\u0627\u0642 \u0623\u064A\u0636\u064B\u0627 \u0643\u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u0631\u0627\u0628\u0637. \u064A\u0645\u0643\u0646 \u0623\u0646 \u064A\u0643\u0648\u0646 \u0647\u0630\u0627 \u0636\u0631\u0648\u0631\u064A\u064B\u0627\u060C \u0639\u0644\u0649 \u0633\u0628\u064A\u0644 \u0627\u0644\u0645\u062B\u0627\u0644\u060C \u0625\u0630\u0627 \u062A\u0639\u0630\u0631 \u0639\u0644\u0649 \u0647\u062F\u0641 \u0627\u0644\u062A\u0646\u0642\u0644 \u0627\u0633\u062A\u064A\u0639\u0627\u0628 \u0633\u064A\u0627\u0642 \u0645\u0646 xApp state \u0623\u0648 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u063A\u0631\u0636 \u0645\u0646 \u0647\u062F\u0641 \u0627\u0644\u062A\u0646\u0642\u0644 \u064A\u062A\u0636\u0645\u0646 \u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u0625\u0644\u0632\u0627\u0645\u064A\u0629 \u064A\u062C\u0628 \u0625\u062F\u062E\u0627\u0644\u0647\u0627 \u0641\u064A \u0635\u0648\u0631\u0629 \u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u0631\u0627\u0628\u0637.\n\n\u0627\u0644\u0631\u062C\u0627\u0621 \u0645\u0644\u0627\u062D\u0638\u0629 \u0623\u0646 \u0647\u0630\u0647 \u0627\u0644\u0645\u0639\u0627\u0645\u0650\u0644\u0627\u062A \u0633\u062A\u0643\u0648\u0646 \u0645\u0648\u062C\u0648\u062F\u0629 \u0641\u064A \u0631\u0627\u0628\u0637 \u0627\u0633\u062A\u062F\u0639\u0627\u0621 \u0627\u0644\u062A\u0637\u0628\u064A\u0642\u060C \u0648\u0644\u0630\u0627 \u064A\u062C\u0628 \u0645\u0631\u0627\u0639\u0627\u0629 \u062C\u0648\u0627\u0646\u0628 \u062D\u0645\u0627\u064A\u0629 \u0627\u0644\u0628\u064A\u0627\u0646\u0627\u062A \u0648\u0627\u0644\u062E\u0635\u0648\u0635\u064A\u0629.
